public class GettersAndSetters2 {
    public static void main(String[] args) {
        // Create a new Person object by calling the constructor with required parameters
        Person person = new Person("John", "Doe", 30);

        // Set additional attributes using setters
        person.setAddress("123 Main St");
        person.setNationality("American");

        // Get and print all attributes using getters
        System.out.println("First Name: " + person.getFirstName());
        System.out.println("Last Name: " + person.getLastName());
        System.out.println("Age: " + person.getAge());
        System.out.println("Address: " + person.getAddress());
        System.out.println("Nationality: " + person.getNationality());

        // Print the Person object using the toString method
        System.out.println("\nPerson Details: ");
        System.out.println(person); // The toString() method is automatically called here
    }
}
